import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar';
import FilterBar from './components/FilterBar';

function App() {
  return (
    <div className="App">
      <FilterBar main={
              <header className="App-header">
              <img src={logo} className="App-logo" alt="logo" />
            </header>
      }></FilterBar>
    </div>
  );
}

export default App;
